　健康管理成分配合のランチュウ・オランダダシシガシラ用フード。<br>ラクトフェリン、トルラ酵母などの健康管理成分を配合したランチュウ・オランダシシガシラ用健康管理フード。消化率のよい原料を使用しているので高い成長率を示します。また、沈下性の飼料で水に溶け出さず水を汚しません。着色料を使用していないナチュラルフード。【原材料】小麦粉・フィッシュミール・脱脂大豆・イカミール・ヘマトコッカス・トルラ酵母・ラクトフエリン・アスタキチンSOD様酵素・消化酵素・ビタミン類・ミネラル類等【保証成分】粗蛋白40%以上、粗脂肪4.5%以上、粗繊維4%以下、粗灰分12%以下、水分10%以下【給与方法】一日に2～3回、5分以内で食べきれる量を与えてください。【<br>から36ヶ月【原産国または製造地】日本<br><br><br>■商品詳細<br><table width=630 border=1 cellspacing=0><tr><td bgcolor=#ffffcc><p style=margin:10px;>メーカー名：株式会社 ニチドウ<br>商品サイズ：150×65×230mm<br><br>購入単位：1個<br>配送種別：在庫品</p></td></tr></table><br><br><table width=600 border=0 cellspacing=0><tr><td><font size=1>【検索用キーワード】<br>楽天 通販 ニチドウ 金魚用フード 金魚 フード お買い得 えさ 餌 エサ ランチュウ オランダシシガシラ ごはん</font></td></tr></table><style type="text/css">
